commentaire_avis_technique:
Synthèse du diagnostic réalisé le 12/12/2017 :
Hauteur de chute et/ou  la nature du jet contraignantes pour le saumon et la truite de mer ; difficilement franchissables pour la lamproie marine, la truite et l’anguille ;
Puissance dissipée est importante pour l’ensemble des espèces dès que le débit transitant dépasse 0,4 m³/s ;
Nécessité de concevoir un nouveau dispositif.

mesure_corrective_commentaire:
Une expertise a été réalisée le 26/07/2018. Concernant la passe à bassins, les résultats étaient les suivant :
"la chute aval est problématique ainsi que l’agitation dans le 2ème bassin (puissance dissipée) :
 la hauteur de chute (aval) n’est pas conforme pour l’ensemble des espèces cibles ;
 le jet est de type « quasi de surface » de décembre à mars, pas compatible avec les
capacités de franchissement de l’alose, de la lamproie marine et de l’anguille ;
 La puissance dissipée dans le 2ème bassin est trop forte en janvier et février ;
 Il est probable que la passe à poissons soit partiellement franchissable pour le saumon, la
truite de mer et les grosses truites fario"
En aval immédiat de la passe, un seuil est présent avec une hauteur de chute de 0,49 m et un jet plongeant. Il est probable que le seuil soit franchissable pour le saumon, la truite de mer et les grosses truites fario pour certaines conditions hydrologiques mais il est infranchissable pour l'anguille, l'alose et la lamproie marine.

commentaire_avis_technique:
Il était préconisé de :
Pour la montaison : 
- d'augmenter la longueur des bassins et de limiter les apports d'eau en provenance du déversoir qui débouchent dans le troisième bassin ;
- ou de remplacer la passe actuelle par une passe à ralentisseurs;
- d'implanter une passe à anguilles de type "tapis brosse".
Pour la dévalaison : revoir le dispositif en respectant les critères du guide "Prise d'eau Ichtyocompatible"
